import "./News.css";
import { Container, Row, Col } from "react-bootstrap";
import NavBar from "../../components/Navbar/Navbar";
import CardNews from "../../components/Card/CardNews";

function News() {
  return (
    <>
      <NavBar />
      <Container
        fluid
        style={{ backgroundImage: `url("/images/bg-img.png")` }}
        className="cover"
      >
        <Row className="justify-content-md-center">
          <Col md={9}>
            <h1 className="h1">
              Jaksa Agung Perintahkan Bentuk Tim Khusus Tangani Mafia
              Tanah-Pelabuhan
            </h1>
          </Col>
        </Row>
      </Container>
      <Container>
        <Row>
          <Col xs={8}>
            <Row>
              {search
                ? listProduk
                    .filter((produk) => {
                      if (
                        produk.nama.toLowerCase().includes(search.toLowerCase())
                      ) {
                        return true;
                      } else {
                        return false;
                      }
                    })
                    .map((produk) => {
                      return (
                        <Product
                          id={produk.id}
                          nama={produk.nama}
                          harga={produk.harga}
                          gambar={produk.gambar}
                          handler={handleAddCart}
                        />
                      );
                    })
                : listProduk.map((produk) => {
                    return (
                      <Product
                        id={produk.id}
                        nama={produk.nama}
                        harga={produk.harga}
                        gambar={produk.gambar}
                        handler={handleAddCart}
                      />
                    );
                  })}
            </Row>
          </Col>
        </Row>
      </Container>
    </>
  );
}
export default News;
